// src/pages/Home.js

import React from 'react';
import { Link } from 'react-router-dom';
import { FaSignInAlt, FaUserPlus, FaSearch } from 'react-icons/fa'; // Import FaSearch icon
import styles from './Home.module.css';

const Home = () => {
  return (
    <div className={styles.homepage}>
      <header className={styles.header}>
        <h1 className={styles.title}>ProjectReserva</h1>
        <div className={styles.authOptions}>
          <Link to="/login" className={`${styles.authOption} ${styles.authButton}`}>
            <FaSignInAlt size={20} />
            <span>Login</span>
          </Link>
          <Link to="/register" className={`${styles.authOption} ${styles.authButton}`}>
            <FaUserPlus size={20} />
            <span>Register</span>
          </Link>
        </div>
      </header>
      <div className={styles.content}>
        <p className={styles.subtitle}>Your go-to platform for booking bus tickets hassle-free!</p>
      </div>
      <div className={styles.searchSection}>
        <input type="text" placeholder="Enter source location" className={styles.searchInput} />
        <input type="text" placeholder="Enter destination location" className={styles.searchInput} />
        <button className={styles.searchButton}>
          <FaSearch size={20} />
        </button>
      </div>
    </div>
  );
};

export default Home;
